import React from "react";
import { directive, tsPropertySignature } from "@babel/types";

export default function ProfilePage(props) {
    return (
        <div>
            <section>
                <h1>User</h1>
                <p>*{props.user.name}*</p>
            </section>
            <section>
                <h1>Theme</h1>
                <p>{props.theme.name}</p>
            </section>
        </div>
    )
}
